				<Card style={{ width: 300 }} className="Card">
					<p>Hehehehe55</p>
				</Card>
				<Card className="Card" style={{ width: 200, marginLeft: 10 }}>
					<p>Hehehehe3434</p>
				</Card>
			</div>
		</>
	);
};
export default Cardtheme;
